import * as React from "react";
import { View, TextInput, Button, Text, StyleSheet } from "react-native";
import FontAwesome from "react-native-vector-icons/FontAwesome";

export default function SignUpScreen() {
  const [password, setPassword] = React.useState("");
  const [firstname, setFirstmame] = React.useState("");
  const [lastname, setLastname] = React.useState("");
  const [email, setEmail] = React.useState("");

  return (
    <View>
      <Text>Sign Up</Text>
      <TextInput style={styles.input} placeholder="First Name"></TextInput>
      <TextInput style={styles.input} placeholder="Last Name"></TextInput>
      <TextInput
        style={styles.input}
        value={email}
        onChangeText={setEmail}
        placeholder="Email"
      ></TextInput>
      <TextInput
        style={styles.input}
        placeholder="Password"
        secureTextEntry
        value={password}
        onChangeText={setPassword}
      ></TextInput>
      <Button title="Sign Up"></Button>
      <TouchableOpacity
        onPress={() => {}}
        style={{
          borderColor: "#ddd",
          borderWidth: 2,
          borderRadius: 10,
          paddingHorizontal: 30,
          paddingVertical: 10,
        }}
      >
        <FontAwesome name="google" height={24} width={24} />
      </TouchableOpacity>
      <TouchableOpacity
        onPress={() => {}}
        style={{
          borderColor: "#ddd",
          borderWidth: 2,
          borderRadius: 10,
          paddingHorizontal: 30,
          paddingVertical: 10,
        }}
      >
        <FontAwesome name="facebook-square" height={24} width={24} />
      </TouchableOpacity>
      <TouchableOpacity
        onPress={() => {}}
        style={{
          borderColor: "#ddd",
          borderWidth: 2,
          borderRadius: 10,
          paddingHorizontal: 30,
          paddingVertical: 10,
        }}
      >
        <FontAwesome name="twitter" height={24} width={24} />
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  input: {},
});
